import React from 'react'
import {Grid, Typography, Tooltip, makeStyles} from '@material-ui/core'
import { AddRounded } from '@material-ui/icons'

interface IProps{
    title: string
    handleAddIngredient: () => void
}

const styles = makeStyles((theme) => ({
    subHeaderContainer:{
        display:'flex',
        justifyContent: 'space-between',
        padding:'1vw'
    }
}))

const MenuListSubHeader: React.FC<IProps> = (props) => {

    const {title, handleAddIngredient} = props

    const useStyle = styles() 
    return(
        <Grid
            className={useStyle.subHeaderContainer}
            container>
            <Grid
                item>
                <Typography variant='h5'>{title}</Typography>
            </Grid>
            <Grid
                item>
                <Tooltip title='Add Ingrdient'>
                    <AddRounded/>
                </Tooltip>
            </Grid>
        </Grid>
    )
}

export default MenuListSubHeader
